import React, { Component } from "react";

class DateAuthor extends Component {
  state = {};
  render() {
    return (
      <div
        style={{
          display: "flex",
          alignContent: "center",
          fontFamily: "Unna",
          fontSize: 18,
        }}
      >
        <span
          style={{
            marginRight: 10,
            backgroundColor: "rgba(252, 186, 3, .65)",
            padding: 3,
          }}
        >
          Welcome to the gulag
        </span>
        <div
          style={{
            backgroundColor: "black",
            width: 1,
            height: 20,
            display: "inline-block",
          }}
        ></div>
        <span style={{ marginLeft: 10 }}>November 19, 2020</span>
      </div>
    );
  }
}

export default DateAuthor;
